}) }}

={{ 
    (() => {
        const query = $('EWT').item.json.query;
        const filters = [
            item => query.name ? item.plan.toLowerCase().includes(query.name.toLowerCase()) : true,
        ];

        const filteredData = $json.data.filter(item => filters.every(fn => fn(item)));
        return filteredData.length ? filteredData : $json.data;
    })()
}}

